import React from "react"
import s from "./App.css"


function App(props) {
  let list = //create variable
      props.state.map((element)=>{// call medot map, it return each element massiv state
        return  <div className={s.item}>
          <input type="checkbox"/>
          <div>{element}</div> {/*// read div teg plus elemnt*/}
        </div>
      })
  return (
    <div>
      <div>
        {list}
      </div>
      <div>
        <input type="text"/>
        <button className={s.button}></button>
      </div>
    </div>
  );
}

export default App;
